            "conteudo": "Processo 1002576-14.2015.8.26.0554 - Execução de Título Extrajudicial - Alienação Fiduciária - BANCO SANTANDER (BRASIL) S.A. - Defiro a pesquisa requerida em relação à CNSeg. Para tanto, deverá o exequente protocolar cópia desta decisão, QUE SERVIRÁ DE OFÍCIO, diretamente no órgão em questão, consignando que a resposta deverá vir aos autos em 10 dias. Procedi à pesquisa de veículos pela via eletrônica (RenaJud). Se positiva, proceda ao bloqueio de transferência do(s) veículo(s). De igual modo, efetuei pesquisa eletrônica de bens do réu via InfoJud. Caso se trate de envio de declaração de bens, a serventia deverá cadastrar \"segredo de justiça\" para tramitação do feito e efetuar as anotações necessárias (NSCGJ, art. 121-B, art. 1263, e Provimento CG 21/2018). Determinei a indisponibilidade de ativos financeiros, nos termos do art. 854, do Código de Processo Civil, até o limite da execução pelo sistema BacenJud, conforme extrato que segue, bem como a transferência do referido valor para o Banco do Brasil S.A, agência 5596, à ordem e disposição deste Juízo. Neste particular, se positivo, aguarde-se a vinda aos autos do(s) comprovante(s) do(s) depósito(s) judicial(is). Citado pessoalmente os réus, não se manifestaram e não constituíram advogado nos autos. Diante disso, o prazo de 05 dias para oferecimento de impugnação, fluirá independentemente de intimação pessoal, devendo se contado a partir da publicação desta decisão, no DJE. Havendo impugnação, com fundamento no art. 10, do CPC, dê-se ciência à parte contrária para manifestação, pelo mesmo prazo, tornando os autos conclusos. Em caso de ausência de impugnação, fica a indisponibilidade convertida em penhora, dispensada a lavratura de termo, por expressa previsão legal. Somente neste caso, com a vinda aos autos do(s) depósito(s) judicial(is), expeça-se o competente mandado de levantamento em prol do credor. Se efetivado o bloqueio integral no valor da execução, após as formalidades supra e com o levantamento pelo credor, tornem os autos conclusos para extinção (art. 924, II, CPC). Porém, se parcial, após o abatimento da importância acima citada, pelo exequente, defiro a ordem de bloqueio do débito remanescente através deste ofício a ser encaminhado ao BANCO CENTRAL DO BRASIL, no endereço abaixo, no(s) qual(is) deverá(ão) constar o(s) nº(s) do(s) CPF (ou CNPJ) do(a)(s) executado(a)(s) indigitado(a)(s), requisitando-se o bloqueio das contas e aplicações financeiras existentes em nome do(a)(s) mesmo(a)(s), até o limite da importância do cálculo que vier a ser juntado aos autos, com transferência das quantias eventualmente bloqueadas para conta judicial vinculada a este Juízo, junto ao Banco do Brasil S.A., agência 5596. Do ofício deverá constar, ainda, que tão logo seja atingido o montante supramencionado, deverá ser efetuado o desbloqueio das contas e ou aplicações financeiras, independentemente de nova ordem deste Juízo. Em caso de restar negativo o procedimento supra, por ausência de valores ou ainda se irrisórios, deverá o exequente requerer o que de direito para o regular trâmite da execução, em igual prazo acima mencionado. No silêncio, remetam-se os autos ao arquivo até nova provocação da parte interessada. Ante a revogação do Comunicado CG nº1788/2017, o pedido de bloqueio de valores não são passíveis de formalização via sistema BACENJUD 2.0, devendo ser encaminhados pelo sistema de protocolo digital, mediante acesso ao link https://bcb.gov.br/acessoinformacao/protocolodigital. CUMPRA-SE, SERVINDO ESTA DECISÃO DE OFÍCIO JUDICIAL, que deverá ser instruído com copia da petição inicial e aditamento, quando o caso, que contenham o cálculo atualizado do debito e o(s) nº(s) do(s) CPF/MF (ou CNPJ) do(a)(s) executado(a)(s). A impressão do(s) documento(s) - ofício(s) - caberá à parte interessada, mediante consulta no endereço eletrônico oficial do TJSP, sendo desnecessário o comparecimento em Cartório para a respectiva retirada, comprovando-se o protocolo do(s) ofício(s), no prazo de vinte (20) dias. Intime-se. - ADV: ADRIANA SANTOS BARROS (OAB 117017/SP), SIMONE APARECIDA GASTALDELLO (OAB 66553/SP)",
