            "despacho": "Cível  RELAÇÃO Nº 0333/2020\r\nJUÍZO DE DIREITO DA 4ª VARA CÍVEL JUIZ(A) DE DIREITO FREDERICO DOS SANTOS MESSIAS ESCRIVÃ(O) JUDICIAL RITA DE CÁSSIA RIBEIRO DE MOURA EDITAL DE INTIMAÇÃO DE ADVOGADOS",
