            "paginaFinal": 1209,
            "varaDescricao": "4ª VARA CÍVEL",
            "conteudo": "Processo 1018171-63.2014.8.26.0562 - Execução de Título Extrajudicial - Contratos Bancários - BANCO SANTANDER ( BRASIL ) S/A - FORNECEDORA DE NAVIOS BANDEIRANTES LTDA - - MARIA HELENA DE SOUZA LOURENCO - - JOSE CARLOS MAXIMO LOURENCO - Vistos. INDEFIRO o pedido de pesquisa de bens pelo sistema Infojud em relação à pessoa jurídica, pois ante a Instrução Normativa RBF nº 1.422 e o Ato Declaratório Executivo Cofis nº 098/2013, ambos de 19 de dezembro de 2013, a Declaração de Informações Econômico-Fiscais de Pessoa Jurídica (DIPJ) deixou de ser obrigatória desde o exercício de 2015 (ano-calendário 2014), passando a ser substituída pela entrega de Escrituração Contábil Fiscal (ECF) que também no sistema Infojud abrange tão somente o exercício 2015 (ano-calendário 2014) e o exercício 2016 (ano-calendário 2015), além do que este documento é extenso detalhamento contábil da empresa, comumente excedendo quinhentas folhas e muitas das vezes superando os milhares. Assim, seu eventual deferimento gerará morosidade não só para a realização do ato em si, mas também para juntada dos resultados nos autos e mesmo para as simples consultas processuais futuras, visto o excessivo número de páginas que o feito passará a conter. No mais, não restou demonstrada de forma justificada a pertinência da pesquisa no caso concreto, vez que o almejado é a pesquisa de bens, que poderão ser solicitadas, se em termos, pesquisas com essa finalidade específica (Renajud, Bacenjud, Arisp, etc), bem como diligências com tal finalidade (penhora e avaliação). Defiro a expedição do ofício requerido. A PARTE INTERESSADA DEVERÁ PROVIDENCIAR A INSTRUÇÃO E O ENVIO DA DECISÃO COM AS CÓPIAS NECESSÁRIAS PARA A EXATA COMPREEENSÃO DA ORDEM JUDICIAL. A CÓPIA DA PRESENTE DECISÃO, ASSINADA DIGITALMENTE, SERVIRÁ DE OFÍCIO/MANDADO PARA OS FINS NELA DETERMINADOS. CABERÁ AO INTERESSADO A IMPRESSÃO E O ENVIO DA DECISÃO, COMPROVANDO, MEDIANTE PETIÇÃO NOS AUTOS, O SEU PROTOCOLO EM ATÉ 10 DIAS. Intime-se. - ADV: ADRIANA SANTOS BARROS (OAB 117017/SP), LUIZ PAULO TURCO (OAB 122300/SP), SIMONE APARECIDA GASTALDELLO (OAB 66553/SP)",
