            "conteudo": "Processo 1033832-03.2019.8.26.0564 - Procedimento do Juizado Especial Cível - CNH - Carteira Nacional de Habilitação - Amauri de Oliveira - DETRAN - DEPARTAMENTO ESTADUAL DE TRÂNSITO - SÃO PAULO - - Prefeitura de São Bernardo de Campo - - Prefeitura Municipal de São Paulo - - DEPARTAMENTO DE ESTRADAS E RODAGEM - DER - Vistos. Dispensado o relatório nos termos do artigo 38º da lei 9.099/95. Decido. Consta que o autor tem contra si, um procedimento administrativo para cassação do direito de dirigir de nº 15131-2/2019, resultando na cassação de sua C.N.H. O autor requer que seja cancelado o processo administrativo, que lhe imputa pontuação sobre infrações que alega não ter cometido. Houve a declaração do real condutor ROSE KELLY MENDES DE OLIVEIRA, portadora do CPF n. 347.239.378-54, a qual assume que é o real condutor e responsável pelas infrações cometidas AIT 57055268-3, 1U920735-6 e 5A802900-3, aplicada ao veículo de placa FHU 5499, devendo lhe ser transferida as pontuações. O que se pretende é a exclusão da infração de trânsito, praticada na direção de veículo automotor, portanto, de responsabilidade do motorista/condutor indicado. Entendo que a declaração com firma reconhecida em Cartório sirva como confissão por parte do condutor. Confissão é o Meio pelo qual a pessoa capaz reconhece e declara como verdadeiro o fato que se lhe imputa ou contra ela é alegado. A confissão de culpa é elemento probatório incontestável. Neste sentir: \"Sendo o infrator flagrado conduzindo veículo, encerrado o prazo para a entrega da CNH, será instaurado processo administrativo de cassação do direito de dirigir, nos termos do inciso I, do artigo 263 do CTB\". (grifo nosso). Não foi o caso. Quanto ao alegado de que tal acordo desqualifica a autarquia, temos: RECURSO ESPECIAL Nº 1.774.306 - RS (2018/0272351-5) RELATOR : MINISTRO GURGEL DE FARIA RECORRENTE : EDI MARIA SCHROEDER ADVOGADO : PAULO ROBERTO VASCONCELOS PEDROSO - RS006062 RECORRIDO : DEPARTAMENTO ESTADUAL DE TRÂNSITO PROCURADOR : IGOR KOEHLER MOREIRA E OUTRO(S) - RS021308 EMENTA PROCESSUAL CIVIL E ADMINISTRATIVO. RECURSO ESPECIAL. ART. 1.022 DO CPC/2015. FUNDAMENTAÇÃO DEFICIENTE. INFRAÇÃO DE TRÂNSITO. INDICAÇÃO DO CONDUTOR DO VEÍCULO. INÉRCIA DO PROPRIETÁRIO. COMPROVAÇÃO DO VERDADEIRO RESPONSÁVEL EM SEDE JUDICIAL. POSSIBILIDADE. 1.. 3. O decurso do prazo previsto no art. 257, § 7º, do CTB acarreta somente a preclusão administrativa, não afastando o direito de o proprietário do veículo, em sede judicial, comprovar o verdadeiro responsável pelo cometimento da infração, sob pena de ofensa ao que dispõe o art. 5º, inc. XXXV, da Constituição da República. 4. Recurso especial conhecido em parte e, nessa extensão, provido para cassar o acórdão impugnado. .. verifica-se que o aresto combatido manteve a responsabilidade da recorrente pela infração de dirigir em excesso de velocidade (art. 218, II, do CTB) e, por consequência, imputou-lhe a prática prevista no art. 162, I, do referido código tão somente porque não teria comunicado, no momento oportuno, o verdadeiro condutor do veículo. Todavia, em caso semelhante, esta Casa de Justiça entendeu que a preclusão do prazo para informar o real condutor do veículo é meramente administrativa, pois \"a verdade dos fatos a que chegou o Judiciário é suficiente para afastar a presunção jurídica de autoria (e, consequentemente, de responsabilidade) criada na esfera administrativa\" (AgRg no Ag 1370626/DF, Relator Ministro MAURO CAMPBELL MARQUES, SEGUNDA TURMA, DJe 27/04/2011). Com efeito, o proprietário do automóvel tem o direito de buscar a via judicial a fim de demonstrar que não foi o responsável pela infração de trânsito, não podendo o Poder Judiciário eximir-se de apreciar tal pleito, sob pena de desconsiderar o preceito constitucional estampado no art. 5º, XXXV, da Carta Magna. É o que se observa nas hipóteses de mitigação da regra estampada no art. 134 do CTB. Confiram-se: AgRg no REsp 1.482.835/RS, Rel. Ministro HUMBERTO MARTINS, Segunda Turma, DJe 14/11/2014, e AgRg no AREsp 427.337/RS, Rel. Ministra REGINA HELENA COSTA, Primeira Turma, DJe 1º/07/2015. Assim, impõe-se o retorno dos autos ao Juízo de origem, a fim de que analise a pretensão do autor, à luz do suporte fáticoprobatório presente nos autos. Ante o exposto, CONHEÇO, EM PARTE, DO RECURSO ESPECIAL e, nessa extensão, DOULHE PROVIMENTO para, cassando a sentença e o acórdão que a confirmou, reconhecer a possibilidade de o proprietário questionar judicialmente a responsabilidade pela infração decorrente de atos praticados na direção do veículo, após o decurso do lapso temporal administrativo. É como voto. (grifei)\" Assim, pelo entendimento acima exposto, temos que, houve a preclusão administrativa para apresentação do real condutor, não se podendo falar em desqualificação da autarquia. Posto isso JULGO PROCEDENTE a ação, e determino a transferência dos pontos relativos aos AIT 57055268-3, 1U920735-6 e 5A802900-3, para o nome de ROSE KELLY MENDES DE OLIVEIRA, bem como, exclua o bloqueio de cassação lançado no prontuário da autora. Torno definitiva a liminar anteriormente concedida. Sem condenação em custas e honorários nesta fase processual. P.R.I. - ADV: SONIA MARIA JOSE MARSIGLIO MATRICARDI (OAB 43231/SP), ADRIANA SANTOS BUENO ZULAR (OAB 131066/SP), CÉSAR CARVALHO DE PAULA CÔRTES (OAB 430340/SP), LUCAS ADRIANO GONÇALVES DE MORAES (OAB 436677/SP)",
            "resumo": "Processo 1033832-03.2019.8.26.0564 - Procedimento do Juizado Especial Cível - CNH - Carteira Nacional de Habilitação - Amauri de Oliveira - DETRAN - DEPARTAMENTO ESTADUAL DE TRÂNSITO - SÃO PAULO - -",
