            "despacho": "X - Ipiranga\r\nFóruns Regionais e Distritais  RELAÇÃO Nº 0143/2020 3ª Vara Cível\r\nJUÍZO DE DIREITO DA 3ª VARA CÍVEL JUIZ(A) DE DIREITO CARLOS ANTONIO DA COSTA ESCRIVÃ(O) JUDICIAL JULIANA TANDE HIGA EDITAL DE INTIMAÇÃO DE ADVOGADOS",
            "paginaInicial": 3905,
            "paginaFinal": 3905,
            "varaDescricao": "CÍVEL",
            "conteudo": "Processo 1000990-51.2017.8.26.0010 - Execução de Título Extrajudicial - Contratos Bancários - Banco Santander Brasil S/A - Patricia Rosa Barduque - - Claudinei Barduque e outros - Vistos. 1. Fls. 330/349: defiro a penhora dos imóveis pertencentes à garantidora-executada CASA MAIS BONITA MATERIAIS DE CONSTRUÇAO E ACABAMENTO LTDA (atual denominação de NOVO MIX Distribuidora de Materiais de Construção e Acabamento Ltda ME) descritos nas matrículas nº 97.529, 97.530 e 97.531 do CRI de Itapecerica da Serra/SP (fls. 332/337, 338/343 e 344/349), ficando nomeada como depositária a própria empresaexecutada CASA MAIS BONITA, na pessoa de seu representante legal. 2. Providencie a Serventia a lavratura de 03 (três) termos de penhora. 3. Concedo ao banco-exequente o prazo de 10 (dez) dias para recolher as custas postais, após o que será expedida carta de intimação da empresa-executada CASA MAIS BONITA, na pessoa de seu representante legal (no endereço de fls. 141/142), acerca da lavratura dos termos de penhora e da nomeação dela como depositária (CPC/2015, artigo 841, § 2º), ficando-lhe concedido o prazo de 15 (quinze) dias para, querendo, apresentar impugnação ou, então, deverá o banco-exequente informar se pretende a expedição de carta precatória. 4. Considerando que os executados PATRÍCIA, CLAUDINEI e SP111 encontram-se representados processualmente, ressalto que a intimação deles acerca da penhora e da nomeação da empresaexecutada CASA MAIS BONITA como depositária aperfeiçoar-se-á através da regular publicação desta decisão (NCPC, art. 841, § 1º). 5. Oportunamente, tais constrições serão averbadas nas respectivas matrículas imobiliárias, através do sistema ARISP. 6. Fls. 350/353: defiro a juntada. Int. - ADV: ADRIANA SANTOS BARROS (OAB 117017/SP), RICARDO BARBOZA PAVAO (OAB 219628/SP), FERNANDO SCARTOZZONI (OAB 234545/SP), SIMONE APARECIDA GASTALDELLO (OAB 66553/SP)",
