            "despacho": "Cível  RELAÇÃO Nº 0130/2020\r\nJUÍZO DE DIREITO DA 5ª VARA CÍVEL JUIZ(A) DE DIREITO VILSON PALARO JUNIOR ESCRIVÃ(O) JUDICIAL PATRICIA ROBERTA DALLANTONIA EDITAL DE INTIMAÇÃO DE ADVOGADOS",
            "paginaInicial": 1919,
            "paginaFinal": 1919,
            "varaDescricao": "5ª VARA CÍVEL",
